/*

This includes 20 different visualizations that I have made. The program cycles through all of the different visualizations without user input, based off of `frameCount`. This is from another program that I made that takes user input:
https://www.khanacademy.org/computer-programming/moving-3d-objects/4625302091333632



*/

/**

I have been programming for about three years now. I started programming on Khan Academy about a year ago. I have finished Intro to JS: Drawing and Animation, Advanced JS: Games and Visualizations, and most of Advanced JS: Natural Simulations.

I'm from Round Rock, TX, and am a homeschooler in 8th Grade. What I love about programming is that the only limit is your imagination. When you make a game, per say, you can define crazy and outlandish forces that affect your character. Or you can create a new cipherer that uses some irrational number to make the input indecipherable. It's all up to you.

**/

smooth();
var starttime = ((((((year() - 2000) * 12 + month()) * 31 + day()) * 24 + hour()) * 60) + minute()) * 60 + second();

var drawBackground = function() {
    var whichShape = floor(frameCount / 300) % 21;
    noStroke();
    if (whichShape !== 9) {
        background(20, 209, 219);
    }
    var ellipseSize = 10;
    if (whichShape === 0) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * 1 + frameCount);
                var y = (i * 5) * sin(j * 10 + i * 1);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 1) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * 3 + frameCount);
                var y = (i * 5);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 100, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 2) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * 1 + frameCount);
                var y = (i * 5) * sin(j * 10 + i * 1 - frameCount);
                fill(0);
                ellipse(x + 200, y + 200, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 3) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * 2 + frameCount);
                var y = (i * 5) * sin(j * 10 + i * 0.5 - frameCount);
                var size = 1 * sin(frameCount) + i / 2;
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, size, size);
            }
        }
    } else if (whichShape === 4) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * frameCount);
                var y = (i * 5) * sin(j * 10 + i * frameCount);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 5) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 10 + i * frameCount);
                var y = (i * 5) * sin(j * 10 + i * 1);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 6) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * 36 + i * 1);
                var y = (i * 5) * sin(j * frameCount / 10 + i * 1);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, ellipseSize, ellipseSize);
            }
        }
    } else if (whichShape === 7) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * frameCount / 10 + i / 100);
                var y = (i * 5) * sin(j * 10 + i * 0.5);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, 5, 5);
            }
        }
    } else if (whichShape === 8) {
        for (var i = 0; i < 40; i ++) {
            for (var j = 0; j < 40; j ++) {
                var x = (i * 5) * cos(j * frameCount / 20 + i * 0.5);
                var y = (i * 5) * sin(j * 10 + i * frameCount / 3000);
                fill(i * 5, 0, j * 10);
                ellipse(x + 200, y + 200, 5, 5);
            }
        }
    } else if (whichShape === 9) {
        var circles = 300;
        // clear the background
        fill(0, 0, 0, 100);
        rect(0, 0, width, height);
        var time;
        //time = starttime + millis() * 0.001;
        time = starttime + millis() / 1000;

        for (var i = 1; i <= circles; i ++) {

            var s = i / circles;

            fill(255 * (1 - s), 255 * s, 255);

            var radius = (1 + sin((time * s) * 175 * 1.5)) * width / 5 + width / 20;

            var angle = (time * s) - 0.5 * time;

            ellipse(radius * cos(angle) + 200, radius * sin(angle) + 200, 5, 5);
        }
    } else if (whichShape === 10) {
        background(0);
        var x = 100 * sin(pow(frameCount, 1.01));
        noFill();
        stroke(255);
        strokeWeight(3);
        for (var i = 0; i < 15; i ++) {
            ellipse(cos(x) * pow(i, 1.9) + 200, sin(x) * pow(i, 1.9) + 200, i * 15, i * 15);
        }
    } else if (whichShape === 11) {
        for (var i = 0; i < 30; i ++) {
            for (var j = 0; j < 15; j ++) {
                var x = (i * 5) * cos(i + frameCount);
                var y = (i * 5) * sin(j  + frameCount);
                fill(i * 10, 0, j * 20);
                ellipse(x + 200, y + 200, 5, 5);
                ellipse(y + 200, x + 200, 5, 5);
                ellipse(200 - x, 200 - y, 5, 5);
                ellipse(200 - y, 200 - x, 5, 5);
            }
        }
    } else if (whichShape === 12) {
        background(0);
        for (var i = 0; i < 75; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            var x = 100 * sin(i * 5);
            var y = 100 * cos(i * 5);
            var timesX = 1;
            if (i % 2 === 0) {
                timesX = -1;
            }

            var timesY = cos(frameCount);
            if (i % 2 === 0) {
                timesY = sin(frameCount);
            }

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
        }
    } else if (whichShape === 13) {
        background(0);
        for (var i = 0; i < 400; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            noStroke();
            fill(0, 0, 50 * sin(i * 10) + 100);
            var x = 100 * sin(i * 1);
            var y = 100 * cos(i * 5);
            var timesX = 1;

            var timesY = cos(frameCount);

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
        }
    } else if (whichShape === 14) {
        background(0);
        for (var i = 0; i < 1000; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            noStroke();
            fill(0, 0, 50 * sin(i * 10) + 130);
            var x = 100 * sin(i * 1);
            var y = 100 * cos(i * 5);
            var timesX = 1;

            var timesY = cos(i * sin(frameCount) + frameCount);

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
        }
    } else if (whichShape === 15) {
        background(0);
        for (var i = 0; i < 75; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            var x = 100 * sin(i * 5);
            var y = 100 * cos(i * 5) - 90;
            var timesX = 1;
            if (i % 2 === 0) {
                timesX = -1;
            }

            var timesY = cos(frameCount);
            if (i % 2 === 0) {
                timesY = sin(frameCount);
            }

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
            ellipse(timesX * -x + 200, timesY * -y + 200, 20, 20);
        }
    } else if (whichShape === 16) {
        background(0);
        for (var i = 0; i < 75; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            var x = 100 * sin(i * 5) + 45;
            var y = 100 * cos(i * 5 + 45) + 45;
            var timesX = 1;
            if (i % 2 === 0) {
                timesX = -1;
            }

            var timesY = cos(frameCount);
            if (i % 2 === 0) {
                timesY = sin(frameCount);
            }

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
            ellipse(timesX * -x + 200, timesY * -y + 200, 20, 20);
            ellipse(timesX * -x + 200, timesY * y + 200, 20, 20);
            ellipse(timesX * x + 200, timesY * -y + 200, 20, 20);
        }
    } else if (whichShape === 17) {
        background(0);
        for (var i = 0; i < 75; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            var x = 100 * sin(i * 5 + 60);
            var y = 100 * cos(i * 5 + 30);
            var timesX = sin(frameCount);
            if (i % 2 === 0) {
                timesX = -cos(frameCount);
            }

            var timesY = cos(frameCount);
            if (i % 2 === 0) {
                timesY = sin(frameCount);
            }

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
            ellipse(timesX * -x + 200, timesY * y + 200, 20, 20);
        }
    } else if (whichShape === 18) {
        background(0);
        for (var i = 0; i < 75; i ++) {
            noFill();
            stroke(10 * i);
            strokeWeight(2);
            var x = 100 * sin(i * 5 + 60);
            var y = 100 * cos(i * 5 + 30);
            var timesX = sin(frameCount);
            if (i % 2 === 0) {
                timesX = -cos(frameCount);
            }

            var timesY = cos(frameCount);
            if (i % 2 === 0) {
                timesY = sin(frameCount);
            }

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
            ellipse(timesX * -x + 200, timesY * y + 200, 20, 20);
        }
    } else if (whichShape === 19) {
        background(0);
        for (var i = 0; i < 200; i ++) {
            var x = (i * 0.75) * cos(i * 20 + frameCount);
            var y = (i * 0.75) * sin(i * 10 + frameCount);
            noFill();
            stroke(0, 10 * sin(i) + 100, i);
            strokeWeight(1);
            ellipse(x + 200, y + 200, 20, 20);
        }
    } else if (whichShape === 20) {
        background(0);
        for (var i = 0; i < 72; i ++) {
            noFill();
            stroke(0, 0, 50 * sin(i * 10) + 100);
            strokeWeight(2);
            var x = 100 * sin(i * 5) + 50;
            var y = 100 * cos(i * 5);
            var timesX = cos(frameCount + sin(frameCount));
            var timesY = cos(frameCount + sin(frameCount));

            ellipse(timesX * x + 200, timesY * y + 200, 20, 20);
        }
    }
};

var draw = function() {
    drawBackground();
};
